.goodClass{
    .title{
        font-size 14px;
        color: rgba(0, 0, 0, 0.85);
        position relative;
        padding-left 11px;
        font-weight bold;
        &:after{
            position absolute;
            content ' ';
            width 2px;
            height 14px;
            background-color #1890FF;
            left:0;
            top:3px;
        }
    }
    .list{
        .item{
            width 264px;
            margin 20px 30px 0 0;
            cursor pointer;
            .pictrue{
                width 100%;
                height 496px;
                border: 1px solid #EEEEEE;
                border-radius: 10px;
                img{
                    width 100%
                    height 100%
                    border-radius: 10px;
                }
            }
            .name{
                font-size: 13px;
                color: rgba(0, 0, 0, 0.85);
                margin-top 26px;
                text-align center;
            }
            &.on{
                .pictrue{
                    border: 2px solid #1890FF;
                }
                .name{
                    color #1890FF;
                }
            }
        }
    }
}
